import React, {Component} from 'react';

const ImageList = (props) => {
    const getImages = props.map(image => {
        return (
            <div>
                <img src={props.urls.small} alt="sa"/>
            </div>
        )
    })
    return(
        <div>
            {getImages}
        </div>
    )

}



export default ImageList;
